import React from 'react';
import Stack from '@mui/material/Stack';
import './Cameras.css';
import 'reactjs-popup/dist/index.css';
import RightArrow from './Images/arrow_forward_ios_black_24dp.svg'
import LeftArrow from './Images/'

function CameraMaster(){
    return(
        <div style={{textAlign: 'center'}}>
            <p style={{margin: '10px'}}>Enter Camera IP Address</p>
            <input type="text" style={{textAlign: 'center'}} id="enterIP"></input>
            <Stack direction="row" spacing={2} justifyContent="center" alignItems="center">
            <button style={{margin: '10px'}} className="buttonParent" onClick={AddCamera}>Add Camera</button>
            </Stack>
            <ControlCenter/>
        </div>
    )
}
function ControlCenter(){
    return(
        <div style={{textAlign: 'center', padding: '100px'}}>
            <Stack direction="row" spacing={2} justifyContent="center" alignItems="center">
            <p className="cameraScreen" id="screen">Placeholder Camera Screen</p>
            </Stack>
        </div>
    )
}
function AddCamera(){
    console.log("Adding Camera");
}
